webpackJsonp([0x717e66409366],{1090:function(e,t){e.exports={pathContext:{group:[{node:{id:"e121dcd8-98ee-4688-9ad4-3807f3970caf",title:"iO West Is Shutting Down Next Week - Splitsider",link:"http://splitsider.com/2018/02/io-west-is-shutting-down-next-week/",body:{value:'<blockquote>\r\n<a href="https://www.io-west.com/">iO West</a>, the Los Angeles branch of Chicago’s iO Theater (formerly ImprovOlympic) founded by Del Close and Charna Halpern, is closing its doors for good next week.\r\n</blockquote>\r\n\r\n<p>At first it struck me as odd that many of my comedy friends on social media were talking about this like someone close to them had passed away, but I eventually realized that I\'ve just been out of the comedy scene too long. If this happened to my home theater back in the <a href="http://improvboston.com">ImprovBoston</a> days, I probably would have reacted the exact same way. Running a theater is an inherently risky business and 25 years is quite an accomplishment. I hope everyone finds a new home to keep doing what they love.</p>'},relationships:{image:null},fields:{slug:"/link/io-west-is-shutting-down-next-week-splitsider/"},post_type:"link",created:1518665977}},{node:{id:"45501ece-503a-484a-9271-42dda3056169",title:"DrupalEasy Podcast 205 - Fatima Khalid - First time sprinter's guide",link:"https://www.drupaleasy.com/podcast/2018/02/drupaleasy-podcast-205-fatima-khalid-first-time-sprinters-guide",body:{value:'<blockquote>\r\nFatima Khalid (<a href="https://www.drupal.org/u/sugaroverflow">sugaroverflow</a>), web developer with <a href="https://www.echidna.ca/">Digital Echidna</a>, and DrupalCon Nashville track chair and sprint mentor joins Mike Anello to talk about how to be a first-time sprinter at a local Drupal event or a DrupalCon and how she came for the community and stayed for the code.\r\n</blockquote>\r\n\r\n<p>Thought this was a really fun and accessible overview of what a sprint is like. I found them very intimidating at first and I think hearing an overview like this in advance would have helped.  Don\'t know how many first time sprinters are avid listeners of Drupal podcasts, but any little bit helps.<p>'},relationships:{image:null},fields:{slug:"/link/drupaleasy-podcast-205-fatima-khalid-first-time-sprinter's-guide/"},post_type:"link",created:1518647919}},{node:{id:"1c83f607-e827-4c13-ba40-c1209ddaf56e",title:"Designer-Oriented Styles - James Kyle",link:"https://the-pastry-box-project.net/james-kyle/2018-january-22",body:{value:'<blockquote>Each of these have trees of components which are made up of other components and elements (often named different things). Each element in the tree is independently styled. It\'s not built around cascading styles and the expectation is that you can copy any element and place it anywhere else and it will look identical.</blockquote>\r\n<p>Interesting way to think about this - the end result of CSS-in-JS might just be what our designers wanted all along.</p>\r\n<blockquote>Note: I’m going refer to “CSS-in-JS” as “Component-Oriented Styles” from here on out, because JavaScript really doesn’t have much to do with it. “CSS” will refer to the traditional way of writing .css files with selectors and all.</blockquote>\r\n<p>I also really like the term "Component-Oriented Styles." Be it a methodology like <a href="http://getbem.com/">BEM</a> or a library like <a href="https://www.styled-components.com/">Styled Components</a>, we\'re really just trying to make styles predictable within the scope of of a reusable component.</p>'},relationships:{image:null},fields:{slug:"/link/designer-oriented-styles-james-kyle/"},post_type:"link",created:1518473671}},{node:{id:"09671a80-beb1-4a31-bc35-f90c5cbc9fe6",title:"To PESOS or to POSSE - Dries Buytaert",link:"https://dri.es/to-pesos-or-to-posse",body:{value:'<blockquote>\r\n<p>The <a href="https://indieweb.org">IndieWeb movement</a> has provided two clever names for these models:\r\n</p>\r\n<ol>\r\n <li><strong>PESOS</strong> or <a href="https://indieweb.org/PESOS">Publish Elsewhere, Syndicate (to your) Own Site</a> is a model where publishing begins on third party services, such as Facebook, and then copies can be syndicated to your own site.</li>\r\n<li><strong>POSSE</strong> or <a href="https://indieweb.org/POSSE">Publish (on your) Own Site, Syndicate Elsewhere</a> is a publishing model that begins with posting content on your own site first, then syndicating out copies to third party services.</li>\r\n</ol>\r\n</blockquote>\r\n<p>I\'ve been thinking about this as well as I build out this website. I fall into the POSSE camp, and right now it\'s completely manual and mostly just me posting links on Twitter. To some extent, I\'m even fine with this website just being its own disconnected thing. It will always be a small subset of my social network that would make it here and actually read something, and that seems just about right.</p>'},relationships:{image:null},fields:{slug:"/link/to-pesos-or-to-posse-dries-buytaert/"},post_type:"link",created:1518367028}},{node:{id:"5096b4b3-3485-4732-a28a-f1ec89dce818",title:"Gatsby Source Drupal Filters by Published",link:null,body:{value:'<p>When initially setting up <a href="https://www.gatsbyjs.org/packages/gatsby-source-drupal/">gatsby-source-drupal</a> for this site I started thinking about how I could adjust my GraphQL query to only include published posts. I eventually realized that the plugin was already doing that by default. That isn\'t always the case for stuff like this, so it was a nice time saver.</p>\r\n\r\n<p>I also found that <a href="https://www.gatsbyjs.org/packages/gatsby-source-drupal/">gatsby-source-drupal</a> seems to work best with <a href="http://www.contentacms.org/">Contenta</a> for some reason.  More on that soon - I\'m hoping to have a longer post on Drupal and Gatsby at some point.</p>'},relationships:{image:null},fields:{slug:"/note/gatsby-source-drupal-filters-by-published/"},post_type:"note",created:1518356069}}],pathPrefix:"",first:!1,last:!1,index:8,pageCount:9,additionalContext:{}}}}});
